// @remaining : integer
//     the number of remaining carrots that exist in stock
// Constrain:
// * 0 <= number <= 1000
// * 0 <= need <= 1000
// * 0 <= remaining <= 1000
func eat:[]num done:num need:num stock:num
    if need <= stock
