    assert "__YESIMHERE.NuLl__" (strongest "__YESIMHERE" ["t" "eMptY" "nothing" "zeR00" "NuLl__" "123NoooneB321"])
    assert "K.TAR" (strongest "K" ["Ta" "TAR" "t234An" "cosSo"])
    assert "__HAHA.123" (strongest "__HAHA" ["Tab" "123" "781345" "-_-"])
