    assert "finNNalLLly.WoW" (strongest "finNNalLLly" ["Die" "NowW" "Wow" "WoW"])
    assert "_.Bb" (strongest "_" ["Bb" "91245"])
    assert "Sp.671235" (strongest "Sp" ["671235" "Bb"])
end

