// and symbols A,B,C,D,E,F are always uppercase.
// Examples:
// hexprimes "AB" // 1
// hexprimes "1077E" // 2
// hexprimes "ABED1A33" // 4
// hexprimes "123456789ABCDEF0" // 6
// hexprimes "2020" // 2
func hexprimes:num str:string
    primes := {}
    for p := range "2357BD"
        primes[p] = true
    end
    result := 0
    for ch := range str
        if (has primes ch)
            result = result + 1
        end
    end
    return result
end

