    assert 2 (hexprimes "1077E")
    assert 4 (hexprimes "ABED1A33")
    assert 2 (hexprimes "2020")
    assert 6 (hexprimes "123456789ABCDEF0")
    assert 12 (hexprimes "112233445566778899AABBCCDDEEFF00")
    assert 0 (hexprimes "")
end

