//  For example:
//  changeSize [1,2,3,5,4,7,9,6] //4
//  changeSize [1, 2, 3, 4, 3, 2, 2] //1
//  changeSize [1, 2, 3, 2, 1] //0
func changeSize:num nums:[]num
    result := 0
    length := len nums
    for i := range (floor length/2)
        if nums[i] != nums[-i - 1]
            result = result + 1
        end
    end
    return result
end

