    assert true (sortedWithShift [])
    assert true (sortedWithShift [1])
    assert true (sortedWithShift [1 2])
    assert true (sortedWithShift [2 1])
    assert true (sortedWithShift [2 3 1])
    assert false (sortedWithShift [2 1 3])
end

