    assert {a:1 b:1 c:1 d:1 g:1} (histogram "a b c d g")
    assert {r:1 t:1 g:1} (histogram "r t g")
    assert {b:4} (histogram "b b b b a")
    assert {r:1 t:1 g:1} (histogram "r t g")
    assert {} (histogram "")
    assert {a:1} (histogram "a")
end

