// Write a function that returns True if the object q will fly, and False
// otherwise. The object q will fly if it's balanced (it is a palindromic
// list) and the sum of its elements is less than or equal the maximum
// possible weight w.
//
// Example:
// willFly [1 2] 5 Ã¢Å¾Å¾ False
// 1+2 is less than the maximum possible weight, but it's unbalanced.
//
// willFly [3 2 3] 1 Ã¢Å¾Å¾ False
// # it's balanced, but 3+2+3 is more than the maximum possible weight.
//
// willFly [3 2 3] 9 Ã¢Å¾Å¾ True
// # 3+2+3 is less than the maximum possible weight, and it's balanced.
//
// willFly [3] 5 Ã¢Å¾Å¾ True
// # 3 is less than the maximum possible weight, and it's balanced.
func willFly:bool nums:[]num w:num
    length := len nums
    if length == 0
        return false
    end
    sum := 0
    for n := range nums
        sum = sum + n
    end
    if sum > w
        return false
    end
    for i := range (floor length/2)
        if nums[i] != nums[-i - 1]
            return false
        end
    end
    return true
end

